import styled from "styled-components";
import { Link } from 'react-router-dom';
import '../App.css';

const MainWindow = styled.div`
  margin: 0 auto;
  width: 500px;
`

const SignIn = () => {
  return (
    <>
      <Link to='/Dashboard'>Домой</Link>
      <p>Ссылка сработала, заебись</p>
    </>
  );
}

export default SignIn;
